var languages = ["Swift":9000, "OC":8600, "PHP":3400, 	"Perl":4300 , "Ruby":5600 , "Go": 5600]// 删除key为"PHP"的key-value对languages.removeValueForKey("PHP")// 删除key为"Perl"的key-value对languages.removeValueForKey("Perl")// 下面输出：[Go: 5600, OC: 8600, Ruby: 5600, Swift: 9000]println(languages)println(languages.count)  // 输出4// 删除key为"Go"的key-value对languages["Go"] = nilprintln(languages)  // 输出[OC: 8600, Ruby: 5600, Swift: 9000]// 删除所有元素languages.removeAll()println(languages)  // 输出[:]println(languages.count)  // 输出0